				["init"] = {
					["custom"] = "-- Default Locale --\naura_env.defaultLocale = 'enUS'\n-- User Locale Var--\naura_env.userLocale = GetLocale()\n-- Get Text sinppet --\naura_env.get_text_snippet = function(name)\n  if aura_env.textSnippets[name] and aura_env.textSnippets[name][aura_env.userLocale] then\n    return aura_env.textSnippets[name][aura_env.userLocale]\n  end\n  if aura_env.textSnippets[name] and aura_env.textSnippets[name][aura_env.defaultLocale] then\n    return aura_env.textSnippets[name][aura_env.defaultLocale]\n  end\n  return name\nend\n-- World quest Availibility --\naura_env.is_world_quest_available = function(quest)\n  if not C_TaskQuest.GetQuestTimeLeftSeconds(quest) then\n    return true\n  end\n  return false\nend\n-- Quest Completion check --\naura_env.is_quest_completed = function(quest)\n  if C_QuestLog.IsQuestFlaggedCompleted(quest) then\n    return true\n  end\n  return false\nend\n-- Enlightened Faction --\naura_env.factionID = 2478\n-- Title items --\n--Norah#21256 thank you for French Tranlations\n--Beatrice#2650 & Podwiznaia#2373 thank you both for help with the Russian Translations\n--Shokuhou (Orillion), Lars, phoi thank you all for your japanese Translations\n--Shokuhou (Orillion) thank you for your Dutch Translations\n--Zamy thank you for your Koreran Translations\n--#3388 thank you for your Translations\n--hohunide thank you for your Translations\n--N3cro#92 thank you for your German Translations\naura_env.textSnippets = {\n  overviewHeadline = { enUS = ' Todo list:',\n    deDE = 'Aufgabenliste:',\n    zhTW = ': ', \n    zhCN = ' :', \n    ruRU = '  ' ,\n    frFR = 'Liste de choses  faire :' ,\n    jaJP = ' ',\n    koKR = '  ',\n  },\n  \n  worldBoss = { \n    enUS = 'World Boss: ',\n    deDE = 'Weltboss: ',\n    zhTW = '', \n    zhCN = 'BOSS: ',\n    ruRU = ' :',\n    frFR = 'Boss mondial: ',\n    nlNL = 'Wereld Baas',\n    jaJP = '',\n    koKR = '',\n  },\n  \n  worldQuests = {\n    enUS = 'World Quests: ',\n    deDE = 'Welt-Quests: ',\n    zhTW = '', \n    zhCN = ': ',\n    ruRU = ' :',\n    frFR = 'Qutes mondiales: ',\n    nlNL = 'World Quests',\n    jaJP = '',\n    koKR = ' ',\n  },\n  \n  weeklyQuest = {\n    enUS = 'Aiding the Accord: ',\n    deDE = 'Untersttzung des Abkommens ',\n    zhTW = '', \n    zhCN = ' ',\n    ruRU = ' : ',\n    frFR = 'Aider le concordat: ',\n    nlNL = 'Accord Assistentie',\n    jaJP='',\n    koKR = ' ',\n  },\n  \n  CommunityFeast = {\n    enUS = 'Community Feast: ',\n    deDE = 'Gemeinschaftsfest: ',\n    zhTW = '', \n    zhCN = ' ',\n    ruRU = ' : ',\n    frFR = 'Festin tribal:  ',\n    nlNL = 'Gemeenschap`s Feestmaal',\n    jaJP = '',\n    koKR = ' ',\n  },\n  \n  elements = {\n    enUS = 'Trial of Elements: ',\n    deDE = 'Prfung der Elemente:',\n    zhTW = ': ', \n    zhCN = ':  ',\n    ruRU = ' : ',\n    frFR = 'Lpreuve des lments: ',\n    nlNL = 'Test van de Elementen',\n    jaJP = '',\n    koKR = ' ',\n  },\n  \n  flood = {\n    enUS = 'Trial of Flood: ',\n    deDE = 'Prfung der Flut:',\n    zhTW = ': ', \n    zhCN = ' ',\n    ruRU = ' : ', \n    frFR = 'Lpreuve du dluge:  ',\n    nlNL = 'Test van de Overstroming',\n    jaJP = '',\n    koKR = ' ',\n  },\n  \n  SoDK = {\n    enUS = 'Siege of Dragonscale Keep: ',\n    deDE = 'Belagerung der Drachenschuppenburg: ',\n    zhTW = ' ', \n    zhCN = ': ',\n    ruRU = '  : ',\n    frFR = 'Siege du Fleau-des-dragons: ',\n    nlNL = 'Belegering van Fort Dragonscale',\n    jaJP =' ',\n    koKR = '   ',\n  },\n  \n  Hunt = {\n    enUS = 'Grand Hunts: ',\n    deDE = 'GroBe Jagden: ',\n    zhTW = ': ', \n    zhCN = ': ',\n    ruRU = ' : ',\n    frFR = 'Grandes Chasses: ',\n    nlNL = 'Grootse Jachten',\n    jaJP = '',\n    koKR = ' ',\n  },\n}\n-- TODO - Items --\naura_env.todoList = {\n  {name = \"weeklyQuest\", maximum = 1,\n    quests = {\n      {questId = 70750,},--Aiding the Accord-- \n    },\n  },\n  \n  {name = \"CommunityFeast\",maximum = 1,\n    quests = {\n      {questId = 70893,},-- Hidden quest ID 70893--\n    },\n  },\n  \n  {name = \"SoDK\",maximum = 1,\n    quests = {\n      {questId = 70866,},-- confirm this Hidden ID72025 0r 70866--\n    },\n  },\n  \n  {name = \"Hunt\",maximum = 1,\n    quests = {\n      {questId = 70906,},-- WS 25.44,92.29-- Epic\n      -- {questId = 69998,},-- WS 25.44,92.29--\n      -- {questId = 69999,},-- WS 40.98,84.46--\n      -- {questId = 70000,},-- WS 25.44,92.29--\n    },\n  },\n  {name = \"flood\",maximum = 1,\n    quests = {\n      {questId = 71033,}, --Raging Torrent mobID 197221 hidden ID 71033 --\n    },\n  },\n  {name = \"elements\",maximum = 1,\n    quests = {\n      {questId = 71995,}, --Therrocite mob id 197749--\n    },\n  },\n  \n  { name = \"worldBoss\",  maximum = 1,\n    quests = {\n      {questId = 65234,}, -- Bazual mobID 193532, hidden ID####--\n      {questId = 65262,},-- Liskanoth  mobID 193533, hidden ID####--\n      {questId = 65231,},-- Strunraan mobID 193534, hidden ID####--\n      {questId = 65115,},-- Basrikron mobID 193535, hidden ID####--\n      \n    },\n  },\n  \n}\n\n--Output Varible--\naura_env.text = '';\n--Output Main function--\naura_env.update_overview_display = function()\n  local text = ''\n  -----------------------------------------------------Todo list Prep--------------------------------------------------------------------------- \n  for _, todoEntry in ipairs(aura_env.todoList) do\n    -- PINK --\n    local entry, color, completed, maximum = '', 'ffff00ff', 0, #todoEntry.quests\n    if \n    --set up the items to display\n    -- todoEntry.name == 'worldQuests' and aura_env.config['includeWorldQuest'] or -- < not need in this version \n    todoEntry.name == 'worldBoss' and aura_env.config['includeWorldBoss'] or -- world boss\n    todoEntry.name == 'CommunityFeast' and aura_env.config['includeCommunityFeast'] or-- Tuskarr Community Feast--\n    todoEntry.name == 'elements' and aura_env.config['includeelements'] or--Trial of Elements --\n    todoEntry.name == 'flood' and aura_env.config['includeFlood'] or--Trial of Floods --\n    todoEntry.name == 'SoDK' and aura_env.config['includeSoDK'] or--Siege of Dragonscale Keep --\n    todoEntry.name == 'Hunt' and aura_env.config['includeHunt'] or--Grand Hunts --\n    todoEntry.name == 'weeklyQuest' and aura_env.config['includeWeeklyQuest'] then--Aiding the Accord--\n      if todoEntry.maximum then\n        maximum = todoEntry.maximum\n      end\n      for _, todoQuest in ipairs(todoEntry.quests) do\n        if todoEntry.name == 'worldBoss' then\n          if aura_env.is_quest_completed(todoQuest.questId) then\n            completed = completed + 1\n          end\n        else\n          if aura_env.is_quest_completed(todoQuest.questId) then\n            completed = completed + 1\n          end\n        end\n      end\n      if (maximum > 1) and (completed >= (maximum / 2)) then\n        -- Burnt Orange --\n        color = 'ffff7801'\n      end \n      if completed >= maximum then\n        -- JADE--\n        color = 'FF00ff96'\n      end\n      \n      if completed >= maximum then\n        if\n        --check if the use wants to hide the line after complete\n        -- todoEntry.name == 'worldQuests' and not aura_env.config['hideWorldQuestsIfCompleted'] or\n        todoEntry.name == 'worldBoss' and not aura_env.config['hideWorldBossIfCompleted'] or\n        todoEntry.name == 'CommunityFeast' and not aura_env.config['hideCommunityFeastIfCompleted'] or -- Tuskarr Community Feast--\n        todoEntry.name == 'elements' and not aura_env.config['hideelementsIfCompleted'] or --Trial of Elements --\n        todoEntry.name == 'flood' and not aura_env.config['hideFloodIfCompleted'] or --Trial of Floods --\n        todoEntry.name == 'SoDK' and not aura_env.config['hideSoDKIfCompleted'] or--Siege of Dragonscale Keep --\n        todoEntry.name == 'Hunt' and not aura_env.config['hideHuntIfCompleted'] or --Grand Hunts --\n        todoEntry.name == 'weeklyQuest' and not aura_env.config['hideWeeklyQuestIfCompleted'] then --Aiding the Accord--\n          entry ='    ' ..  aura_env.get_text_snippet(todoEntry.name) .. ': ' .. WrapTextInColorCode(completed .. ' / ' .. maximum, color) .. '\\r\\n'\n        end\n      else\n        entry ='    ' .. aura_env.get_text_snippet(todoEntry.name) .. ': ' .. WrapTextInColorCode(completed .. ' / ' .. maximum, color) .. '\\r\\n'\n      end\n      \n      text = text .. entry\n    end\n  end\n  \n  return text\nend\n\n--Update output varible--\naura_env.update_display = function()\n  local text = ''\n  ---todo list items update---\n  if aura_env.config['showOverview'] then -- cheack if use want to show\n    text ='  ' .. text .. WrapTextInColorCode(aura_env.get_text_snippet('overviewHeadline'), 'ff00ff96') .. '\\r\\n'--apped header\n    text = text .. aura_env.update_overview_display() .. '\\r' --append todo list items\n  end \n  return text\nend\naura_env.text = aura_env.update_display()",
