			["wagoID"] = "9MpDLGWp3",
			["parent"] = "Primals module (WIP)",
			["displayText"] = "%c",
			["customText"] = "function()\n    aura_env.text = aura_env.update_display()\n    \n    return aura_env.text \nend",
			["shadowYOffset"] = -1,
